import { useState } from 'react';

const Home = () => {

    const [steps, setSteps] = useState([
        {title: 'School Officer', id: 1},
        {title: 'Head Of Department', id: 2}
    ]);
    return ( 
        <div className = "home">
            {steps.map((step) => (
                <div className = "step-preview" key = {step.id}>
                    <h2>{ step.title }</h2>
                </div>
            ))}
        </div>
    );
}
 
export default Home;
